import React, { Component } from 'react';

export class App extends Component {


constructor()
{
 super();
 this.state={
   data:"muhammad adil asar"
 }
}
  render() {
    return(
     <>
    <h3>
      {this.state.data}
    </h3>
    
    </>
    );
  }
}

export default App;
